💚عِندَمِا يَخرُج شَيءٌ مِن حَياتِك لاتَحزَن ؛ بَلْ انظر إلَى آلسّمآءْ وَقل : 
{ عَوضنيّ يـا رَب بخَيرٍ مِنهْ }
